            <Routes>
                <Route path='/'>
                    <HomePage pokemon={pokemon}/>
                </Route>
                <Route path='/pokemon/:pokemonName'>
                    {/* <PokeDetails/> */}
                </Route>
            </Routes>
        </Router>
    </div>
  )
}

export default Content
